// @match        *://*/*
// @icon         data:image/gif;base64,R0lGODlhAQABAAAAACH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==
// @grant        none
// ==/UserScript==

const keyboard_data = "data:audio/mpeg;base64,";
const click_data = "data:audio/mpeg;base64,"


let keyboard = new Audio(keyboard_data);
let countdown = 0;
document.body.addEventListener("keypress", ()=>{
	countdown = 1000;
});
setInterval(()=>{
	if(countdown > 0){
		keyboard.play();
		countdown -= 100;
	}
	else{
		keyboard.pause();
	}
}, 100);

document.body.addEventListener("click", ()=>{
    let audio = new Audio(click_data);
	audio.volume = 0.3;
    audio.play();
});
